const EditRestaurante = () => {
  const parametros=useParams()
  function regresarMenu(){
    window.location.assign("http://192.168.1.4:3000/Restaurantes");
}
  return (
    <div>
      <CabeceraEditRestaurante/>
      <MenusRestaurantes/>
    </div>
  )
}

export default EditRestaurante
